import React, { Component } from 'react';
import "./fontawesome"

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div className="container">
                <div className="row">
                <div className="col-md-6 col-xs-12" style={{padding:"2vw",borderRight:"1px solid rgba(242,242,242,0.7)"}}>
        <h2 style={{fontWeight:"bolder",color:"#004d99"}}>Member Login</h2><br/>
    

       <form method="post" action="/customers/login">
       <label for="email">Email/User</label>
    <input type="text" id="email"  name="username" placeholder=" " className="form-control" /><br/>

    <label for="password">Password</label><br/>
     <div className="input-group ">     
                <input type="password" className="form-control" pattern="[a-zA-Z0-9/]+" title="<b>Must contain text and numbers</b>" name="password" id="password" placeholder="" name="search" style={{padding:"5px",borderRight:"none"}}/>
                <div className="input-group-btn">
                  <button className="btn " className="eye" onclick='changepassType()'  style={{paddingRight: "3px",borderLeft:"0px",border:"1px solid lightgrey",backgroundColor:"white"}}><i className="fa fa-eye-slash fa-2x"></i></button>
                </div>
                 </div><br/>
     <small style={{fontWeight:"bolder",color:"black"}}><input type="checkbox"/>  <span>  Remember  me</span></small> <small style={{float:"right",color:"#004d99"}}>Forgot your password</small>
<input type="hidden" name="_csrf" value="<%= csrfToken %>" />
    <br/><br/><br/>
    <div style={{minWidth: "100%"}}>
     <button type="submit" className="" style={{width: "100%",backgroundColor:"#004d99",borderRadius: "5px",padding: "7px",boxShadow:"1px 3px 3px 1px lightgrey",color:"white"}}><span className="fa fa-sign-in" style={{float:"left",fontSize:"25px"}}></span><span style={{fontWeight:"bolder",color:"white"}}>LOGIN</span></button><br/><br/>
 <button type="button" className="" style={{width: "100%",backgroundColor:"white",borderRadius: "5px",padding: "7px",boxShadow:"1px 3px 3px 1px lightgrey",color:"#004d99"}}><span className="fab fa-facebook" style={{float:"left",fontSize:"20px"}}></span>  <span style={{fontWeight:"bolder"}}>LOGIN WITH FACEBOOK</span></button>
          </div>
 </form>  
      </div>
                </div>
            </div>
            
         );
    }
}
 
export default Login;
